import React from 'react';

//app
import { LossActionTableView } from './LossActionTable.view';

LossActionTable.prototypes = {};

export default function LossActionTable({
  lossActions = { items: [] },
  cols: colsArr,
  columnProps,
}) {

  return (
    <LossActionTableView
      rows={lossActions?.items || []}
      cols={colsArr}
      columnProps={columnProps}
    />
  );
}
